def random_contrast(image, mask, lower=0.5, upper=1.5, u=0.5):
    if np.random.random() < u:
        x = random_channel_shift(image, np.random.uniform(lower, upper))
        y = random_channel_shift(mask, np.random.uniform(lower, upper))
    else:
        x = image
        y = mask
    return x, y

